  //     return <Country Pages={xx}  />;
  //   }else if(Page == 'State'){
  //     return <State Pages={xx}  />;
  //   }
  // }


  return (
    <Router>
      <nav>
        <Link to="/register">Register</Link>
        <Link to="/country">Country</Link>
        <Link to="/state">State</Link>
      </nav>

      <Routes>
        <Route path="/register" element={<Register Pages={xx} />} />
        <Route path="/country" element={<Country Pages={xx} />} />
        <Route path="/state" element={<State Pages={xx} />} />
      </Routes>
    </Router>
  );
}
export default App;
